import React from "react";

export default function Home(){
    let description=[
        {id: 1,text: "We know that in the world of development not everyone who claims to be a programmer can measure up. We don't mean that they mislead customers by promising results, but maybe they don't have the right mindset."},
        {id: 2,text: "For us, the challenge is not to stop learning, doing a lot of research, working hard, making time to test new technologies, learning new programming languages ​​and languages, while dedicating exclusive attention to our clients."},
        {id: 3,text: "Contact us now, we want to take your business to the next level and keep you above your competitors."}]
    return(
        <>
        {/* Hero */}
        <div>
            <h1>
            Are you ready to change the level of your business forever?
            </h1>
            <p>
            We're here to turn your genius into software. You don't need to look any further, we are the team you need.
            </p>
        </div>
        {/* Description */}
        {description?.map(d=>
            <div key={d.id}>
                <p>{d.text}</p>
            </div>)}
        </>
    )
}
